import { TextField, MenuItem, makeStyles, withStyles } from "@material-ui/core";
import React, { useState } from "react";

const StyledText = withStyles({
   paper: {
      border: '1px solid #d3d4d5',
   },
   })((props) => (
   <TextField
      elevation={0}
      getcontentanchorel={null}
      anchororigin={{
         vertical: 'bottom',
         horizontal: 'center',
      }}
      transformorigin={{
         vertical: 'top',
         horizontal: 'center',
      }}
      {...props}
   />
));

const options = [
   {
      value: "test1",
      label: "test1",
   },
   {
      value: "test2",
      label: "test2",
   },
   {
      value: "test3",
      label: "test3",
   },
   {
      value: "test4",
      label: "test4",
   },
]

const useStyles = makeStyles((theme) => ({
   root: {
     '& .MuiTextField-root': {
       margin: theme.spacing(1),
       width: '25ch',
     },
   },
 }));

function TeamRegister(){
   const classes = useStyles();
   const [choice, setChoice] = useState({choices: {test1: "", test2: "", test3: ""}});

   const onChoice = (event) => {
      setChoice(event.target.value);
      console.log(event.target.value)
   }

   return(
      <div>
         <p>
            <b>Rules for Individuals:</b> Any student may compete as an individual 
            in their grade level or any higher grade; however, a student may 
            compete as a team at one grade level only. This applies to both 
            Championships and Masters.<br/>

            Also note each team includes four students in addition to 
            two alternates per school that can compete as individuals. So 
            when registering n teams , you get to bring 4n+2 students along. 
            These students don't need to be registered as individuals separately.
         </p>
         <form class={classes.root} noValidate autoComplete="off">
            <div style={{display:"flex"}}>
               <p>Competition Location</p>
               <TextField
                  select
                  variant="outlined"
                  label="Please Select Location"
                  value={choice.choices.test1}
                  onChange={(event) => {setChoice(
                              {test1:event.target.value,
                               test2:choice.choices.test2,
                               test3:choice.choices.test3}
                        );
                        console.log(choice, "space", event.target.value)
                     }
                  }
               >
                  {options.map((option) => (
                     <MenuItem key={option.value} value={option.value}>
                        {option.label}
                     </MenuItem>
                  ))}
               </TextField>
            </div>
            <div style={{display:"flex"}}>
               <p>Competition Level</p>
               <TextField
                  select
                  variant="outlined"
                  label="Please Select Grade Level"
                  value={choice.choices.test2}
                  onChange={(event) => {setChoice(state => ({
                           choices: {
                              ...state,
                              test1: event.target.value,
                           },
                        }));
                     }
                  }
               >
                  {options.map((option) => (
                     <MenuItem key={option.value} value={option.value}>
                        {option.label}
                     </MenuItem>
                  ))}
               </TextField>
            </div>
            <div style={{display:"flex"}}>
               <p>School Registering</p>
               <TextField
                  select
                  variant="outlined"
                  label="Please Select School"
                  value={choice.choices.test3}
                  onChange={(event) => {setChoice(state => ({
                           choices: {
                              ...state,
                              test1: event.target.value,
                           },
                        }));
                     }
                  }
               >
                  {options.map((option) => (
                     <MenuItem key={option.value} value={option.value}>
                        {option.label}
                     </MenuItem>
                  ))}
               </TextField>
            </div>
            <div>
               <p>Coach</p>
               <TextField>

               </TextField>
            </div>
         </form>
      </div>
   );
}

export default TeamRegister;
